function Dish() {

    useEffect(() => {
        getDish()
    }, [])

    function getDish() {
        fetch('https://www.themealdb.com/api/json/v1/1/random.php')
            .then(response => response.json())
            .then(data => console.log(data))
    }

    return (
        <div></div>
    )
}


export default Dish;
